import React from 'react';
import { OnboardingState } from '../../../data/onboardingTypes';

interface FinishProps {
  data: OnboardingState;
  update: <K extends keyof OnboardingState>(key: K, value: OnboardingState[K]) => void;
}

export function Finish({ data, update }: FinishProps) {
  return (
    <div className="onboarding-step">
      <h1>You're all set!</h1>
      <p>Thanks for setting up your profile. Let's start exploring strategies.</p>
    </div>
  );
}
